window.bookSummaryJSON = "<p><b>Dominant. Dangerous. Obsessed.</b></p> <p>After Dad cut me off, it was time to start over, far away from my past. New city. New university. New life. A whole new me.</p> <p>Too bad <i>they </i>seem hellbent on ruining my plans. The Kings of Kilborn have set their sights on me, threatening to ruin everything I've built for myself.</p> <p>Kaleb is the broken prince, drowning himself in booze and women to fill the dark void within. Hardin is his quietly menacing older brother, with an intense stare that follows me wherever I go.</p> <p>Despised. Desired. Stalked.</p> <p>I try to hate them, but their unyielding attention and rough touches make me feel so alive.</p> <p>Even more dangerous to me than the Kings of Kilborn is their fatherâ€¦ and the secret that could destroy us all.</p> <p><i>Soulless Saint</i> is a dark enemies-to-lovers why-choose romance, meaning the main character will have more than one love interest. Intended for mature listeners.</p>"; 
